import React, { useState } from 'react';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <nav className="bg-white shadow-md">
      <div className="container mx-auto px-4 py-2 flex items-center justify-between">
        <div className="flex items-center">
          <img src="/path-to-your-logo.png" alt="Logo" className="h-8 w-8 mr-2" />
          <img src="/path-to-your-image.png" alt="Nearby Image" className="h-8 w-8" />
        </div>
        <div className="hidden md:flex space-x-6">
          <a href="#home" className="text-black hover:text-gray-700">Home</a>
          <a href="#about" className="text-black hover:text-gray-700">About</a>
          <a href="#services" className="text-black hover:text-gray-700">Services</a>
          <a href="#contact" className="text-black hover:text-gray-700">Contact</a>
          <button className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">Login</button>
        </div>
        <div className="md:hidden flex items-center">
          <button onClick={toggleMenu} className="text-black focus:outline-none">
            <svg className="h-6 w-6 fill-current" viewBox="0 0 24 24">
              <path d="M4 5h16M4 12h16M4 19h16" />
            </svg>
          </button>
        </div>
      </div>
      {isOpen && (
        <div className="md:hidden">
          <a href="#home" className="block text-black hover:text-gray-700 px-4 py-2">Home</a>
          <a href="#about" className="block text-black hover:text-gray-700 px-4 py-2">About</a>
          <a href="#services" className="block text-black hover:text-gray-700 px-4 py-2">Services</a>
          <a href="#contact" className="block text-black hover:text-gray-700 px-4 py-2">Contact</a>
          <button className="block w-full bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">Login</button>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
